import React from 'react';
import { Link, NavLink } from 'react-router-dom';

const Navbar = () => {
  return (
    <header className="fixed top-0 left-0 right-0 bg-white/95 backdrop-blur border-b border-gray-200 z-50">
      <div className="max-w-6xl mx-auto flex items-center justify-between px-4 py-3">
        <Link to="/" className="flex items-center gap-3">
          <div className="h-10 w-10 rounded-lg bg-amber-500 grid place-content-center text-white font-bold">SB</div>
          <div className="font-semibold">Kembove <Enterprises></Enterprises></div>
        </Link>
        <nav className="hidden md:flex gap-6 items-center">
          <NavLink to="/" className={({isActive})=> isActive ? 'text-amber-500 font-semibold' : 'text-gray-700'}>Home</NavLink>
          <NavLink to="/about" className={({isActive})=> isActive ? 'text-amber-500 font-semibold' : 'text-gray-700'}>About Us</NavLink>
          <NavLink to="/products" className={({isActive})=> isActive ? 'text-amber-500 font-semibold' : 'text-gray-700'}>Products</NavLink>
          <NavLink to="/gallery" className={({isActive})=> isActive ? 'text-amber-500 font-semibold' : 'text-gray-700'}>Portfolio</NavLink>
          <NavLink to="/careers" className={({isActive})=> isActive ? 'text-amber-500 font-semibold' : 'text-gray-700'}>Careers</NavLink>
          <NavLink to="/contact" className={({isActive})=> isActive ? 'text-amber-500 font-semibold' : 'text-gray-700'}>Contact</NavLink>
          <Link to="/booking" className="ml-2 bg-amber-500 text-white px-4 py-2 rounded-md font-medium">Book</Link>
        </nav>
        <div className="md:hidden">
          <MobileMenu />
        </div>
      </div>
    </header>
  );
};

const MobileMenu = ()=> {
  const [open, setOpen] = React.useState(false);
  return (
    <div>
      <button onClick={()=>setOpen(!open)} className="p-2 bg-gray-100 rounded-md">
        ☰
      </button>
      {open && (
        <div className="absolute right-4 mt-2 w-48 bg-white rounded-md shadow-lg p-4">
          <NavLink to="/" onClick={()=>setOpen(false)} className="block py-1">Home</NavLink>
          <NavLink to="/about" onClick={()=>setOpen(false)} className="block py-1">About</NavLink>
          <NavLink to="/products" onClick={()=>setOpen(false)} className="block py-1">Products</NavLink>
          <NavLink to="/gallery" onClick={()=>setOpen(false)} className="block py-1">Portfolio</NavLink>
          <NavLink to="/careers" onClick={()=>setOpen(false)} className="block py-1">Careers</NavLink>
          <NavLink to="/contact" onClick={()=>setOpen(false)} className="block py-1">Contact</NavLink>
        </div>
      )}
    </div>
  );
};

export default Navbar;
